import TodoListItem from "./todo-list-item";

const TodoList = ({todos}) => {
    const items = (todos)
    return (
      <ul>
        <li><TodoListItem label = 'task1' important /></li>
        <li><TodoListItem label = 'second task' /></li>
      </ul>
    );
};

export default TodoList;
